import React from 'react';
import { useHistory } from 'react-router-dom';

function App() {
  const history = useHistory();

  const handleOrder = (product) => {
    history.push(`/order/${product}`);
  };

  return (
    <div>
      <header>
        <section>
          <div className="product-item">
            <img src={GreensImages} alt="greens" />
            <h4>GREENS</h4>
            <p>30% offer</p>
            <button onClick={() => handleOrder('greens')}>Order</button>
          </div>
          <div className="product-item">
            <img src={dairyproductImages} alt="Dairy-products" />
            <h4>DAIRY-PRODUCTS</h4>
            <p>20% OFFER</p>
            <button onClick={() => handleOrder('dairy-products')}>Order</button>
          </div>
          <div className="product-item">
            <img src={kitchenwareImages} alt="KITCHENWARE" />
            <h4>KITCHEN-WARE</h4>
            <p>35% offer</p>
            <button onClick={() => handleOrder('kitchenware')}>Order</button>
          </div>
          <div className="product-item">
            <img src={FruitsImages} alt="FRUIT" />
            <h4>FRUITS</h4>
            <p>25% offer</p>
            <button onClick={() => handleOrder('fruits')}>Order</button>
          </div>
        </section>
      </header>
    </div>
  );
}

export default App;
